import Link from "next/link";

const Header = () => {
  return (
    <div className='bg-gray-100 p-4 mb-4 text-gray-500 font-regular text-sm uppercase tracking-wider '>
      <Link href='/'>
        <a>Home</a>
      </Link>
      <Link href='/about'>
        <a>About</a>
      </Link>
    </div>
  );
};

export default Header;
